import React from "react";
import Card from "../../components/Card";
const ExplorePage = ({ houseData, onclickfun }) => {
  return (
    <div className="searchResults" onClick={onclickfun()}>
      {houseData
        ? houseData.map((house, index) => (
            <Card location={house.location.area} image={house.image_path[0]} />
          ))
        : null}
    </div>
  );
};

export default ExplorePage;
